{
  return gotos[state*NUM_NONTERMS+sym];
}

i32 GetReductionNum(i32 state)
{
  return reduction_sizes[state];
}

i32 NumLiterals(void)
{
  return NUM_LITERALS;
}

i32 *GetLiterals(void)
{
  return literals;
}

char *ParseSymbolName(i32 sym)
{
  return parse_symbols[sym];
}

bool IsParseError(i32 action)
{
  return action == ERROR_NUM;
}
